export default  `
    mutation{
        createTrack(input : {
            $playlist : Int
            $title : String
            $source: String
            $sourceId : String
            $quality: String
            $duration: Float
            $thumbnails: JSON
            $position: Int
        }) {
            id
        }
    }
`

